import {
  Chart as ChartJS,
  BarElement,
  CategoryScale,
  LinearScale,
  ArcElement,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(BarElement, CategoryScale, LinearScale, ArcElement, Tooltip, Legend);

// Statistics relevant to freelance admin dashboard
const statsData = {
  labels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun"],
  datasets: [
    {
      label: "Projects",
      data: [5, 8, 6, 10, 7, 9],
      backgroundColor: "#7C3AED",
    },
    {
      label: "Applications",
      data: [12, 15, 14, 18, 16, 20],
      backgroundColor: "#FBBF24",
    },
  ],
};

const projectTypeData = {
  labels: ["Web", "Mobile", "Data", "Design"],
  datasets: [
    {
      data: [12, 7, 5, 8],
      backgroundColor: ["#7C3AED", "#FBBF24", "#10B981", "#F472B6"],
      borderWidth: 0,
    },
  ],
};

const topClients = [
  { name: "Ali Raza", projects: 4, total: "₨320,000" },
  { name: "Fatima Khan", projects: 3, total: "₨210,000" },
  { name: "Bilal Ahmed", projects: 2, total: "₨180,000" },
];

export default function Statistics() {
  return (
    <div className="max-w-5xl mx-auto mt-12 bg-white rounded-2xl shadow-xl p-8">
      <h2 className="text-2xl font-bold mb-6 text-[#7C3AED]">Statistics</h2>
      {/* Summary Cards */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
        <div className="bg-[#7C3AED] text-white rounded-xl p-6 flex flex-col items-center">
          <div className="text-3xl font-bold mb-2">₨1,280,000</div>
          <div className="text-lg">Total Earnings</div>
        </div>
        <div className="bg-[#FBBF24] text-white rounded-xl p-6 flex flex-col items-center">
          <div className="text-3xl font-bold mb-2">27</div>
          <div className="text-lg">Projects Completed</div>
        </div>
        <div className="bg-[#10B981] text-white rounded-xl p-6 flex flex-col items-center">
          <div className="text-3xl font-bold mb-2">18</div>
          <div className="text-lg">Clients Served</div>
        </div>
      </div>
      {/* Charts */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-8">
        <div className="bg-gray-50 rounded-xl p-6">
          <div className="font-semibold mb-2">Projects & Applications (6 months)</div>
          <Bar data={statsData} options={{ responsive: true, plugins: { legend: { position: "top" } }, maintainAspectRatio: true }} />
        </div>
        <div className="bg-gray-50 rounded-xl p-6 flex flex-col items-center">
          <div className="font-semibold mb-2">Project Types</div>
          <div style={{ maxWidth: 260, width: "100%", height: 200 }}>
            <Doughnut data={projectTypeData} options={{ cutout: "70%", plugins: { legend: { display: true, position: "bottom" } }, maintainAspectRatio: true }} />
          </div>
        </div>
      </div>
      {/* Top Clients Table */}
      <div className="bg-gray-50 rounded-xl p-6">
        <div className="font-semibold mb-4">Top Clients</div>
        <table className="min-w-full text-left">
          <thead>
            <tr>
              <th className="py-2 px-4">Client</th>
              <th className="py-2 px-4">Projects</th>
              <th className="py-2 px-4">Total</th>
            </tr>
          </thead>
          <tbody>
            {topClients.map((c, idx) => (
              <tr key={idx} className="hover:bg-gray-100">
                <td className="py-2 px-4 font-medium text-gray-900">{c.name}</td>
                <td className="py-2 px-4">{c.projects}</td>
                <td className="py-2 px-4">{c.total}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
